script: |
  super -f text -I q4809.spq | sort > q4809.out

inputs:
  - name: q4809.spq
    data: |
      SELECT 60 * + ( col1 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - 75 / col0 ) >= ( + col2 - + col0 * - 13 );
  - name: tab0

outputs:
  - name: q4809.out
    data: |
      1260
      4860
      60
